
public class Member {

	private int id;
	private String member_name;

	public Member(int id, String mname) {
		// TODO Auto-generated constructor stub
		this.id = id;
		this.member_name = mname;
	}

	public int getId() {
		return id;
	}

	public String getMember_name() {
		return member_name;
	}

}
